        <script>

    function calcRoute() {
        console.log("Map Starting...")
    }
    
    var mainRows;

    function initMap() {
      var directionsService = new google.maps.DirectionsService;
      var directionsDisplay = new google.maps.DirectionsRenderer;
      var map = new google.maps.Map(document.getElementById('map'), {
        zoom: 7,
        center: {lat: 41.85, lng: -87.65},
        mapTypeId: google.maps.MapTypeId.SATELLITE
      });
      directionsDisplay.setMap(map);

      var onChangeHandler = function() {
        calculateAndDisplayRoute(directionsService, directionsDisplay, map);
      };
      document.getElementById('start').addEventListener('change', onChangeHandler);
      document.getElementById('end').addEventListener('change', onChangeHandler);

      heatmap = new google.maps.visualization.HeatmapLayer({
        data: getPoints(),
        map: map
      });


    setGradient();
    
    google.maps.event.addListenerOnce(map, 'tilesloaded', modulateGradient);


    }

function setGradient() {
    gradient = [
        'rgba(0, 255, 255, 0)',
        'rgba(0, 255, 255, 1)',
        'rgba(0, 191, 255, 1)',
        'rgba(0, 127, 255, 1)',
        'rgba(0, 63, 255, 1)',
        'rgba(0, 0, 255, 1)',
        'rgba(0, 0, 223, 1)',
        'rgba(0, 0, 191, 1)',
        'rgba(0, 0, 159, 1)',
        'rgba(0, 0, 127, 1)',
        'rgba(63, 0, 91, 1)',
        'rgba(127, 0, 63, 1)',
        'rgba(191, 0, 31, 1)',
        'rgba(255, 0, 0, 1)'
    ];
    heatmap.set('gradient', gradient);
}
var gradient, gradientStep = -1;
function modulateGradient() {
    var modulator = function() {
        var newGradient = gradient.slice(0, heatmap.get('gradient').length + gradientStep);
        
        if (newGradient.length == gradient.length || newGradient.length == 7) {
            gradientStep *= -1;
        }
        
        heatmap.set('gradient', newGradient);
        
        setTimeout(modulator, 100);
    };
    
    setTimeout(modulator, 100);
}

function toggleHeatmap() {
  heatmap.setMap(heatmap.getMap() ? null : map);
}

function changeGradient() {
  var gradient = [
    'rgba(0, 255, 255, 0)',
    'rgba(0, 255, 255, 1)',
    'rgba(0, 191, 255, 1)',
    'rgba(0, 127, 255, 1)',
    'rgba(0, 63, 255, 1)',
    'rgba(0, 0, 255, 1)',
    'rgba(0, 0, 223, 1)',
    'rgba(0, 0, 191, 1)',
    'rgba(0, 0, 159, 1)',
    'rgba(0, 0, 127, 1)',
    'rgba(63, 0, 91, 1)',
    'rgba(127, 0, 63, 1)',
    'rgba(191, 0, 31, 1)',
    'rgba(255, 0, 0, 1)'
  ]
  heatmap.set('gradient', heatmap.get('gradient') ? null : gradient);
}

function changeRadius() {
  heatmap.set('radius', heatmap.get('radius') ? null : 20);
}

function changeOpacity() {
  heatmap.set('opacity', heatmap.get('opacity') ? null : 0.2);
}

    function parseAndSendData(overview_polyline){
        var arrayCurrent = [];
        for(var k=0; k<overview_polyline.length; k++){
            var obj = {
                lat: overview_polyline[k].lat(),
                lng: overview_polyline[k].lng(),
            }
            arrayCurrent.push(obj)
        }
        console.log(JSON.stringify(arrayCurrent))
        $.ajax({url: "http://localhost:5000?overview_polyline=" + JSON.stringify(arrayCurrent), success: function(result){
                    console.log(result);

                }
            });
    }
    function calculateAndDisplayRoute(directionsService, directionsDisplay, map) {
      directionsService.route({
        origin: document.getElementById('start').value,
        destination: document.getElementById('end').value,
        provideRouteAlternatives: true,
        travelMode: google.maps.TravelMode.DRIVING
      }, function(response, status) {
        if (status === google.maps.DirectionsStatus.OK) {
            for (var i = 0, len = response.routes.length; i < len; i++) {
                console.log("Routes: " + i);
                console.log(parseAndSendData(google.maps.geometry.encoding.decodePath(response.routes[i].overview_polyline)));

                //google.maps.geometry.encoding.decodePath(response.routes[i].overview_polyline)
                new google.maps.DirectionsRenderer({
                    map: map,
                    directions: response,
                    routeIndex: i
                });
            }
        } else {
          window.alert('Directions request failed due to ' + status);
        }
      });
    }
